{
  signed int ret;
  signed int count = 0;
  char outfn[1024l];
  char *fn;
  struct anonymous_7 *iprc;
  iprc=libraw_init((unsigned int)0);
  if(iprc == ((struct anonymous_7 *)NULL))
  {
    fprintf(stderr, "Cannot create libraw handle\n");
    return (void *)0;
  }

  else
  {
    do
    {
      fn=get_next_file();
      if(fn == ((char *)NULL))
        break;

      iprc->params.half_size = 1;
      iprc->params.use_camera_wb = use_camera_wb;
      iprc->params.use_auto_wb = use_auto_wb;
      iprc->params.output_tiff = tiff_mode;
      ret=libraw_open_file(iprc, fn);
      if(!(verbose == 0))
        fprintf(stderr, "%s: %s/%s\n", fn, (const void *)iprc->idata.make, (const void *)iprc->idata.model);

      do
        if(!(ret == 0))
        {
          const char *return_value_libraw_strerror_1;
          return_value_libraw_strerror_1=libraw_strerror(ret);
          fprintf(stderr, "%s: %s\n", fn, return_value_libraw_strerror_1);
          if(!(ret >= -100000))
          {
            libraw_close(iprc);
            return (void *)0;
          }

        }

      while((_Bool)0);
      ret=libraw_unpack(iprc);
      do
        if(!(ret == 0))
        {
          const char *return_value_libraw_strerror_2;
          return_value_libraw_strerror_2=libraw_strerror(ret);
          fprintf(stderr, "%s: %s\n", fn, return_value_libraw_strerror_2);
          if(!(ret >= -100000))
          {
            libraw_close(iprc);
            return (void *)0;
          }

        }

      while((_Bool)0);
      ret=libraw_dcraw_process(iprc);
      do
        if(!(ret == 0))
        {
          const char *return_value_libraw_strerror_3;
          return_value_libraw_strerror_3=libraw_strerror(ret);
          fprintf(stderr, "%s: %s\n", fn, return_value_libraw_strerror_3);
          if(!(ret >= -100000))
          {
            libraw_close(iprc);
            return (void *)0;
          }

        }

      while((_Bool)0);
      snprintf(outfn, (unsigned long int)1023, "%s.%s", fn, tiff_mode != 0 ? "tiff" : "ppm");
      if(!(verbose == 0))
        fprintf(stderr, "Writing file %s\n", (const void *)outfn);

      ret=libraw_dcraw_ppm_tiff_writer(iprc, outfn);
      do
        if(!(ret == 0))
        {
          const char *return_value_libraw_strerror_4;
          return_value_libraw_strerror_4=libraw_strerror(ret);
          fprintf(stderr, "%s: %s\n", fn, return_value_libraw_strerror_4);
          if(!(ret >= -100000))
          {
            libraw_close(iprc);
            return (void *)0;
          }

        }

      while((_Bool)0);
      count = count + 1;
    }
    while((_Bool)1);
    libraw_close(iprc);
    return (void *)0;
  }
}

