signed int show_files(void *q)
{
  char *p;
  signed int cnt = 0;
  do
  {
    p=get_next_file();
    if(p == ((char *)NULL))
      break;

    printf("%s\n", p);
    cnt = cnt + 1;
  }
  while((_Bool)1);
  return cnt;
}

